            .staticrypt-password-container {
                position: relative;
                outline: 0;
                background: #f2f2f2;
                width: 100%;
                border: 0;
                margin: 0 0 15px;
                box-sizing: border-box;
                border-radius: 12px;

                font-size: 14px;
                cursor: pointer;
                border-radius: 12px;
            }

            .staticrypt-form .staticrypt-decrypt-button:hover {
                background: #4CAF50;
                filter: brightness(92%);
            }

            .staticrypt-html {
                height: 100%;

            .staticrypt-title {
